    true,nt"url": null,nt"notes": "<p>Also known as Medicare Spending per Beneficiary
    (MSPB) Spending Breakdowns by Claim Type file. The data displayed here show average
    spending levels during hospitalsu00e2u0080u0099 Medicare Spending per Beneficiary
    (MSPB) episodes. An MSPB episode includes all Medicare Part A and Part B claims
    paid during the period from 3 days prior to a hospital admission through 30 days
    after discharge.  These average Medicare payment amounts have been price-standardized
    to remove the effect of geographic payment differences and add-on payments for indirect
    medical education (IME) and disproportionate share hospitals (DSH). CMS uses the
    information on this webpage to calculate a hospitalu00e2u0080u0099s MSPB Measure
    value, which is reported on Hospital Compare. Specifically, the MSPB Measure methodology
    risk-adjusts the values on this webpage to account for beneficiary age and severity
    of illness. This webpage provides the pre-risk-adjusted values to help the public
    understand the MSPB Measure and its composition.</p>n",nt"license_title": "Other
